                <div class=""col-12 col-lg-4"">
                    <h5>為什麼選擇樹蛙雨林聯盟的咖啡？</h5>
                    <p>其認證代表該作物符合：</p>
                    <ul>
                        <li><i class=""fa fa-check""></i> 較少的環境污染與浪費。</li>
                        <li><i class=""fa fa-check""></i> 符合農藥限制標準。</li>
                        <li><i class=""fa fa-");
            WriteLiteral(@"check""></i> 保護自然環境與動物棲息地。</li>
                        <li><i class=""fa fa-check""></i> 高成效的管理機制。</li>
                        <li><i class=""fa fa-check""></i> 保障農民權益與競爭力。</li>
                        <li><i class=""fa fa-check""></i> 增進農民與環保團體的合作度。</li>
                    </ul>
                </div>
                <div class=""col-12"">
                    <h5>雨林聯盟認證的意義</h5>
                    <p>&emsp;&emsp;雨林聯盟逐年逐步擴展了與小農的合作，目前已超過200萬農戶獲得了該組織認證。而取得認證的前提，是農場必須符合可持續農業標準，其標準旨在保護生態系統、保護生物多樣性和水道、保護森林、減少農用化學品的使用、改善生計以及維護工人和當地社區的權利和福祉。雨林聯盟鼓勵企業和消費者通過採購或選擇「認證農場」種植的產品來支持可持續農業。截至2019年，超過500萬公頃的農田在雨林聯盟認證下得到可持續管理。全球5.7%的咖啡來自雨林聯盟認證的農場。</p>
