                <h5>認證農場的核心價值</h5>
                <p class=""mb-30"">&emsp;&emsp;為成為雨林認證的一員，農戶及企業對於勞工及自然環境，不再單純以壓榨性方式搾取利益，而更多注重：保護野生動物和水道、為工人準備防護裝備及農用化學品使用指南，並且禁止轉基因作物，最重要的是：監測和減輕童工、強迫勞動、歧視...等工作場所暴力和騷擾的風險問題。</p>
                <h5>全程無污染的認證咖啡</h5>
                <p class=""mb-30"">&emsp;&emsp;取代過往倚賴農藥及大量砍伐林木的耕作法。雨林聯盟採用高成效的農園管理機制,並與當地農民合作,輔導他們實施碳排放較少的耕作技術,透過可持續的耕作不僅能帶來改善土壤質量、節約用水、保護野生動物的棲息地等益處,更能提高現有農田的生產力,產出高品質的咖啡豆。咖啡豆也因為在嚴格限制農藥標準、全程無污染的條件下生長,得以保留本身的絕佳風味。選擇雨林聯盟認證的咖啡，雨林聯盟也會再將收益投入雨林的保護與咖啡農的收益補貼,保障他們的生計與競爭力，達成永續經營的目的。</p>
